import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';

import LoginForm from './LoginForm';
import Navbar from '../../SharedComponents/Navbar';
import './App.css';

function Login() {
  return (
    <div className="App">
      <Navbar isLogged={false} />
      <LoginForm />
    </div>
  );
}

export default Login;
